(1, 'public/uploads/shHzTExgO1KGYhd9XAtuorPBA2ftpAoe.jpg', 'Xiaomi Redmi Note 10S (6GB+64GB) Helio G95 64MP Quad Kamera Layar 6.43 Super AMOLED 5000mAh', 'Xiaomi Redmi Note 10S hadir dengan quad kamera yang siap digunakan untuk memotret momen terbaik sepanjang hari Anda. Bidik apa saja dengan mudah, mulai dari pemandangan yang jauh hingga gambar close-up yang detail. 64MP kamera utama, 8MP kamera ultra-wide, 2MP kamera makro, dan 2MP sensor depth.\r\n\r\nXiaomi Redmi Note 10S dengan 64MP kamera utama, Anda tidak akan melewatkan detail halus sekali pun. Kamera 118? ultra-wide mampu menangkap seluruh cerita dalam satu bingkai. Mode potret AI Bidik kilau cahaya pada malam hari. Ambil foto memukau meskipun dengan setelan cahaya redup.\r\n\r\nXiaomi Redmi Note 10S nikmati semua jenis hiburan dalam warna terang dengan layar Super AMOLED 6.43\"\". 2400*1080 FHD+ DCI-P3 Gamut warna luas Mata yang nyaman sepanjang waktu, dilengkapi dengan sensor cahaya ambien 360?. Secara otomatis menyesuaikan kecerahan. Mode baca 3.0 Seperti membaca buku. Cahaya biru rendah bersertifikasi SGS dirancang untuk kenyamanan mata Anda. \r\n\r\nXiaomi Redmi Note 10S memiliki suara stereo yang menghanyutkan. Dengan volume lebih tinggi dan rentang suara lebih luas, speaker ganda akan membawa Anda ke dunia baru, baik saat menonton film atau bermain game.\r\n\r\nXiaomi Redmi Note 10S memiliki pengisian daya cepat 33W, siap dalam sekejap. Hanya dalam waktu 30 menit, fitur pengisian daya cepat 33W memungkinkan Anda mengisi daya baterai 5000mAh hingga 54%, untuk penggunaan sepanjang hari.*', '2899000', '2699000', NULL, 1, NULL, '2021-12-13 12:50:46', '2021-12-26 18:13:18', 'xiaomi-redmi-note-10s-6gb64gb-helio-g95-64mp-quad-kamera-layar-643-super-amoled-5000mah_BAHj', 1, 8, NULL, NULL, 0, 16, 900),
