(5, 'public/uploads/ePqkX8PzlTmaDCZapU54HWrs6qWJuwf5.jpg', 'asus x7539', 'Layar: 14 inci, 2880 x 1880 piksel\r\nProsesor: Intel Core i5-11300H\r\nGrafis: Nvidia GeForce RTX 3050 Max-Q VRAM 4GB GDDR6\r\nRAM: 16 GB LPDDR4x\r\nStorage: SSD 512 GB\r\nSistem Operasi: Windows 10 Home\r\nKamera: 720p HD camera\r\nBaterai: 3-cell, 63WHr', '5000000', NULL, NULL, 1, 19, '2021-12-15 04:43:52', '2022-01-12 03:34:38', 'asus-x7539', 0, 25, NULL, NULL, 1, 0, 100),
(6, 'public/uploads/4K7BRsiMW8r3FFwcZSDHKFI6JtYpCQhU.jpg', 'flashdiskkingston 8gb', 'Kapasitas 8Gb\r\nRegional U.S.A\r\nMade in Taiwan\r\nFlash drive USB DataTraveler dan IronKey Kingston menyediakan penyimpanan file saat bepergian untuk foto, musik, video, dan masih banyak lagi. Tersedia dalam keamanan standar dan terenkripsi untuk rumah, sekolah, kantor, dan organisasi perusahaan.', '70000', NULL, NULL, 1, 16, '2021-12-26 18:29:38', '2022-01-12 03:38:56', 'flashdiskkingston-8gb', 0, 21, NULL, NULL, 1, 9083, 70),
