(11, 'public/uploads/qTlOU36KLUR7W0ZapuUIqCprc9RACfVu.jpg', 'Hardisk Seagte 1 TB', 'Seagate  Expansion  1TB \r\nSeagate  Expansion  1TB  IndonesiaSeagate  Expansion  1TB Seagate  Expansion  1TB  fiturSeagate  Expansion  1TB  spesifikasi\r\nSimpan dan pindahkan data dengan mudah, praktis, serta aman dengan HDD Seagate Expansion 1000GB. Hardisk Seagate 2.5Inch dengan kecepatan putaran 5400rpm ini sudah mendukung USB 3.0 dan kecepatan transfer mencapai 5000Mbit/s. Hadir dengan ukuran 176 x 120 x 36mm, hardisk eskternal Seagate Expansion Hitam ini dapat kamu beli dengan penawaran harga terbaik di iPrice mulai dari IDR57500', '249000', '50000', NULL, 1, 17, '2022-01-12 01:16:32', '2022-01-12 01:16:32', 'hardisk-seagte-1-tb', 1, 0, NULL, NULL, 1, 10, 1000);
